Accounts_CustomFields_Description:
Debe ser un JSON válido, donde las llaves son los nombres de los campos que contienen las opciones de los campos.
Example:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Debe ser un JSON válido donde las claves sean idiomas que contengan un diccionario de clave y traducciones. Ejemplo: <br/><code>{
"en": {
"Canales": "Habitaciones"
},
"pt": {
"Canales": "Salas"
}
}</code>
